/*:
 * @target MZ
 * @author Brandt (Masked)
 * @plugindesc Shortest path algorithm implementations.
 * @help Schach - Pathfinding
 * 
 * This plugin provides implementations of shortest path algorithms that
 * can be used directly with game characters on the map or on generic
 * graph structures.
 * 
 * It is also extensible via definition of custom path finding/following
 * strategies following a common interface.
 * 
 * @command event_follow_player
 * @text Event follow player
 * @desc Makes an event follow the player using pathfinding.
 * @arg event_id
 * @type number
 * @text Event Id
 * @desc Event Id
 * @arg strategy
 * @type text
 * @text Strategy
 * @desc Pathfinding strategy class to use. The default is usually
 * best.
 * @default Schach.Pathfinding.Strategy.StandardStrategy
 * 
 * @command event_to_point
 * @text Event to point
 * @desc Makes an event go to a point on the map using pathfinding.
 * @arg event_id
 * @type number
 * @text Event Id
 * @desc Event Id
 * @arg point_x
 * @type number
 * @text Point X
 * @desc X coordinate of the target point.
 * @arg point_y
 * @type number
 * @text Point Y
 * @desc Y coordinate of the target point.
 * @arg strategy
 * @type text
 * @text Strategy
 * @desc Pathfinding strategy class to use. The default is usually
 * best.
 * @default Schach.Pathfinding.Strategy.StandardStrategy
 * 
 * @command event_clear
 * @text Clear Event path
 * @desc Cancels path following for an event.
 * @arg event_id
 * @type number
 * @text Event Id
 * @desc Event Id
 * 
 * @command player_follow_event
 * @text Player follow event
 * @desc Makes the player follow an event using pathfinding.
 * @arg event_id
 * @type number
 * @text Event Id
 * @desc Event Id
 * @arg strategy
 * @type text
 * @text Strategy
 * @desc Pathfinding strategy class to use. The default is usually
 * best.
 * @default Schach.Pathfinding.Strategy.StandardStrategy
 * 
 * @command player_to_point
 * @text Player to point
 * @desc Makes the player go to a point on the map using pathfinding.
 * @arg point_x
 * @type number
 * @text Point X
 * @desc X coordinate of the target point.
 * @arg point_y
 * @type number
 * @text Point Y
 * @desc Y coordinate of the target point.
 * @arg strategy
 * @type text
 * @text Strategy
 * @desc Pathfinding strategy class to use. The default is usually
 * best.
 * @default Schach.Pathfinding.Strategy.StandardStrategy
 * 
 * @command player_clear
 * @text Clear Player path
 * @desc Cancels path following for the player.
 */
